import React from "react";
import Table from "@material-ui/core/Table";
import TableBody from "@material-ui/core/TableBody";
import TableCell from "@material-ui/core/TableCell";
import TableContainer from "@material-ui/core/TableContainer";
import TableHead from "@material-ui/core/TableHead";
import TableRow from "@material-ui/core/TableRow";
import Paper from "@material-ui/core/Paper";
import Button from "@material-ui/core/Button";
import TextField from "@material-ui/core/TextField";
import MuiThemeProvider from "material-ui/styles/MuiThemeProvider";
import Axios from "axios";
import socketIOClient from "socket.io-client";

import "./App.css";
import Form from "./Form";

class App extends React.Component {
  constructor() {
    super();
    this.socket = socketIOClient("http://localhost:8080");
    this.socket.emit("new");
    this.state = {
      columns: [
        { title: "Name", field: "name" },
        { title: "Type", field: "type" },
        { title: "Price", field: "price", type: "numeric" },
        { title: "rating", field: "rating", type: "numeric" },
        { title: "warranty years", field: "warranty_years", type: "numeric" }
      ],
      items: []
    };
  }
  handleModify() {
    console.log("clicked");
  }
  handleDelete() {}

  async getItem() {
    const data = await Axios.get("http://localhost:8080/items");
    //    console.log(data);
    const data_string = JSON.stringify(data.data);
    console.log(data_string);
    const data_array = JSON.parse(data_string);
    console.log(data_array);
    this.setState({ items: data_array });
    console.log(this.state.items.length);
  }
  render() {
    if (this.state.items.length < 1) {
      console.log(this.state.items.length);
      this.getItem();
      console.log("salut");
      return (
        <div>
          <header className="App-header">Loading</header>
        </div>
      );
    }
    console.log(this.state.items);
    return (
      <MuiThemeProvider>
        <div className="App">
          <Form
            onSubmit={submission =>
              this.setState({
                items: [...this.state.items, submission]
              })
            }
          />
          <TableContainer component={Paper}>
            <Table className="" aria-label="simple table">
              <TableHead>
                <TableRow>
                  <TableCell>Items</TableCell>
                  <TableCell align="right">type</TableCell>
                  <TableCell align="right">price</TableCell>
                  <TableCell align="right">rating</TableCell>
                  <TableCell align="right">warranty years</TableCell>
                </TableRow>
              </TableHead>
              <TableBody>
                {this.state.items.map(item, i => (
                  <TableRow key={item.name}>
                    <TableCell component="th" scope="row">
                      {item.name}
                    </TableCell>
                    <TableCell align="right">{item.type}</TableCell>
                    <TableCell align="right">{item.price}â‚¬</TableCell>
                    <TableCell align="right">{item.rating}</TableCell>
                    <TableCell align="right">{item.warranty_years}</TableCell>
                    <TableCell>
                      <Button
                        variant="contained"
                        color="primary"
                        onClick={this.handleModify}
                      >
                        modify
                      </Button>
                      <Button
                        variant="contained"
                        color="secondary"
                        onClick={this.handleDelete(item[i]._id)}
                      >
                        delete
                      </Button>
                    </TableCell>
                  </TableRow>
                ))}
                <TableRow>
                  <TableCell>
                    <TextField id="standard-basic" label="Name" align="right" />
                  </TableCell>
                  <TableCell>
                    <TextField id="standard-basic" label="Type" align="right" />
                  </TableCell>
                  <TableCell>
                    <TextField
                      id="standard-basic"
                      label="Price"
                      align="right"
                    />
                  </TableCell>
                  <TableCell>
                    <TextField
                      id="standard-basic"
                      label="Rating"
                      align="right"
                    />
                  </TableCell>
                  <TableCell>
                    <TextField
                      id="standard-basic"
                      label="Warranty"
                      align="right"
                    />
                  </TableCell>
                  <TableCell>
                    <Button variant="contained">add</Button>
                  </TableCell>
                </TableRow>
              </TableBody>
            </Table>
          </TableContainer>
        </div>
      </MuiThemeProvider>
    );
  }
}

export default App;
